import "antd/dist/antd.css";
import React, { useState } from "react";
import { Col, Button, Row, Input } from 'antd';
import { UploadOutlined, PlusOutlined } from '@ant-design/icons';

function App() {
  const [count, setCount] = useState(0);
  const [value, setvalue] = useState(1);

  const onChange = e => {
    console.log('radio checked', e.target.value);
    setvalue(e.target.value);
  }

  return (
    <Col className="ant-col">
      <Row className='row-title'>
        <h1>Upload da DU-E</h1>
      </Row>
      <Row className='row-info'>
        <Row className='ant-number-due'>
          <p>NÂº da DU-E</p>
        </Row>
        <Row className='ant-file'>
          <p>Arquivos</p>
        </Row>
      </Row>   
      <Row className='ant-col-files'>
        <Input />
        <Button
        className='button-upload-file'
        type="primary"
        size="medium"
        icon={<UploadOutlined />}
        >
          Carregar Arquivo
        </Button>
        <Button
        className='button-plus'
        type='primary'
        size='small'
        icon={<PlusOutlined />}
        onClick={() => console.log(setCount(count + 1))}
        ></Button>
      </Row>
      <Row></Row>
    </Col>
  );
}

export default App;
